    for i in range(len(stdin)):
        start, end, length = [int(x) for x in stdin[i].split(" ")]
        if start not in graph:
            graph[start] = {}
        if end not in graph:
            graph[end] = {}
        graph[start][end] = length
        graph[end][start] = length
    # Initialize the previous node
    previous = [0] * (len(graph) + 1)

    # Set the previous node for each node
    for node in graph:
        if node not in graph[node]:
            graph[node][node] = 0
        previous[node] = node

    # Compute the length of the path for each edge
    for node in graph:
        for neighbour in graph[node]:
            graph[node][neighbour] = graph[node][neighbour] + graph[previous[node]][node]
            previous[neighbour] = node

    # Now the path is set, we can calculate the length of the path
    # We need to find the shortest path from Mister George to Luka
    # Find the intersection that mister George is at
    mister_george_at = 0
