        # Find the shortest path from the intersection to Mister George
        current_node = mister_george_at
        path = []
        while current_node!= luka_at:
            path.append(current_node)
            current_node = previous[current_node]
        path.append(luka_at)
        # Find the length of the path
        path_length = 0
        for i in range(1, len(path)):
            path_length += graph[path[i - 1]][path[i]]
        if path_length < min_time:
            min_time = path_length

    return min_time

